import { Component } from "react";

function isEven(count) {
  return count % 2 === 0 ? "Even" : "Odd";
}

export default class App extends Component {

  render = () =>
    <h4 className="bg-primary text-white text-center p-2 m-1">
      Number of things: { isEven(7) }
    </h4>
}
